因为需要遍历链表，时间复杂度是O(n)。

空间复杂度：

因为需要保存临时变量，空间复杂度为O(1)。


从链表中删除元素
常见操作：


删除链表的表头；
删除链表的表尾；
删除链表中任意结点。


删除表头结点
核心思路：

删除表头结点，包含以下4步：

将表头指针指向第二个结点；
将第二个结点的前驱指针指向NULL；
将原表头结点的后继指针指向NULL；
移除原表头结点。



实现代码：


    【&#x1F449;&#x1F3FB;>>点击展开查看代码】 


/**  
 * 删除表头结点  
 *  
 * @author: Max Solider  
 * @date: 2022/10/8 19:38  
 * @param headNode  
 * @return org.example.linkedlist.dll.DllNode  
 */
 DllNode deleteHead(DllNode headNode) {  
    if (headNode == null) {  
        return headNode;  
    }  
    // 如果链表只有一个元素  
    if (headNode.getNext() == null) {  
        headNode = null;  
        return headNode;  
    }  
    // 将表头指针指向第二个结点  
    DllNode newHead = headNode.getNext();  
    // 修改将原表头结点的后继指针  
    headNode.setNext(null);  
    // 修改新表头结点的前驱指针  
    newHead.setPrevious(null);  
    headNode = newHead;  
    return headNode;  
}




