判定链表长度是奇数还是偶数问题描述核心思路实现代码时间复杂度空间复杂度判定链表长度是奇数还是偶数

[!Tip]
本节源代码见Github链接&#x1F517;


问题描述
检查链表的结点数是奇数还是偶数

核心思路
定义一个指向链表头结点，每次向后移动两个结点的指针。若移动到最后，指针指向NULL，则说明链表结点数是偶数；若它指向尾结点，则说明链表结点数是奇数。

